import React from "react";
import { useNavigate } from "react-router-dom";
import "../App.css";

const DataStoragePage = () => {
  const navigate = useNavigate();

  return (
    <div
      style={{
        backgroundColor: "#F0DFC3",
        fontFamily: "Proxima Nova",
        minHeight: "100vh",
        position: "relative",
        padding: "50px 100px",
      }}
    >
      <h1
        style={{
          fontSize: "50px",
          fontWeight: "bold",
          color: "#A6785E",
          textAlign: "center",
          marginBottom: "40px",
        }}
      >
        Editing History
      </h1>
      <div
        style={{
          display: "flex",
          justifyContent: "space-between",
          marginBottom: "80px",
          color: "#50464E",
          fontSize: "30px",
        }}
      >
        <div>
          <p>Document 1</p>
          <p>Line 4: “is” to “are”</p>
          <p>Line 19: “asoduhosa” to “jnsjd”</p>
          <p style={{ color: "#A6785E", cursor: "pointer" }}>Show more edits</p>
        </div>
        <div>
          <p>Document 2</p>
          <p>Line 4: “is” to “are”</p>
          <p>Line 19: “asoduhosa” to “jnsjd”</p>
          <p style={{ color: "#A6785E", cursor: "pointer" }}>Show more edits</p>
        </div>
      </div>

      <h1
        style={{
          fontSize: "50px",
          fontWeight: "bold",
          color: "#A6785E",
          textAlign: "center",
          marginBottom: "20px",
        }}
      >
        Uploaded Files
      </h1>
      <div
        style={{
          display: "flex",
          justifyContent: "center",
          gap: "60px",
          fontSize: "30px",
          color: "#50464E",
        }}
      >
        <p>Document 1</p>
        <p>Document 2</p>
        <p>Document 3</p>
        <p>Document 4</p>
      </div>
      <p
        style={{
          textAlign: "center",
          marginTop: "20px",
          fontSize: "30px",
          color: "#A6785E",
          cursor: "pointer",
        }}
      >
        Show all
      </p>
      <button
        style={{
          fontSize: "20px",
          backgroundColor: "#DEA93D",
          color: "#50464E",
          padding: "10px 30px",
          borderRadius: "10px",
          border: "none",
          cursor: "pointer",
          fontWeight: "bold",
          position: "absolute",
          bottom: "30px",
          right: "30px",
        }}
        onClick={() => navigate("/")}
      >
        Back
      </button>
    </div>
  );
};

export default DataStoragePage;
